import React, {Component} from 'react';
import './App.css';
import Homepage from "./Containers/Homepage/Homepage";
import 'bootstrap/dist/css/bootstrap.min.css';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { BrowserRouter as Router , Route} from 'react-router-dom'
import AboutIntro from "./Components/Homepage/AboutIntro";

import Nav from "./Components/Nav/Nav"
import Footer from "./Components/Footer/Footer";
import ServicesContainer from "./Containers/Services/Services";
import HomeSlider from './Components/Slider/HomeSlider';



export class App extends Component {
  render() {
    return (
      <div className="App">
      <Router >
      <Nav />
      <Route Route path="/reactclockwise/" exact component={Homepage} />

      <Route path="/reactclockwise/about" render={AboutIntro} />
      <Route path="/reactclockwise/services" render={HomeSlider} />
      </Router>
      <Footer />
    </div>
    )
  }
}

export default App
